let currentPage = 1;
const itemsPerPage = 6; // Her sayfada gösterilecek hesap sayısı
let filteredHesaplar = hesaplar; // Varsayılan olarak tüm hesapları göster

// Renkli kostüm isimleri için fonksiyon
function renkliSkin(skin) {
    if (skin.includes("LEGENDARY") || skin.includes("Legendary")) {
        return `<span style="color: red">${skin}</span>`;
    } else if (skin.includes("ULTIMATE") || skin.includes("Ultimate")) {
        return `<span style="color: yellow">${skin}</span>`;
    } else if (skin.includes("MYTHIC") || skin.includes("Mythic")) {
        return `<span style="color: gold">${skin}</span>`;
    } else if (skin.includes("EPIC") || skin.includes("Epic")) {
        return `<span style="color: aqua">${skin}</span>`;
    } else {
        return skin;
    }
}

// Başlangıçta hesapları göster
displayAccountsPaginated(currentPage);

// Filtrelenmiş hesapları sayfalara bölme
function applyFilters() {
    const selectedServer = document.getElementById("server").value.toLowerCase();
    const selectedMaviOz = document.getElementById("maviOz").value;
    const skinQuery = document.getElementById("skins").value.toLowerCase();
    const accNumber = document.getElementById("accNumber").value.trim();

    filteredHesaplar = hesaplar.filter(hesap => {
        // Hesap numarası filtresi
        if (accNumber) {
            const hesapNumarasi = hesap.accNumber.match(/\d+/);
            if (!hesapNumarasi || hesapNumarasi[0] !== accNumber) {
                return false;
            }
        }
        // Sunucu filtresi
        if (selectedServer !== "all" && hesap.server.toLowerCase() !== selectedServer) {
            return false;
        }
        // Mavi Öz filtresi
        if (selectedMaviOz !== "all") {
            const maviOzThreshold = parseInt(selectedMaviOz.replace(/\D/g, ""));
            if (hesap.blueEssence < maviOzThreshold) {
                return false;
            }
        }
        // Kostüm arama filtresi
        if (skinQuery) {
            const matchingSkin = hesap.skins.some(skin => skin.toLowerCase().includes(skinQuery));
            if (!matchingSkin) {
                return false;
            }
        }
        return true;
    });

    currentPage = 1;
    displayAccountsPaginated(currentPage, filteredHesaplar);
}

// Hesapları sayfalara göre gösterme
function displayAccountsPaginated(page, hesaplarToDisplay = filteredHesaplar) {
    const hesapContainer = document.getElementById('hesap-container');
    hesapContainer.innerHTML = '';

    if (hesaplarToDisplay.length === 0) {
        hesapContainer.innerHTML = '<p class="no-results-message">Sonuç bulunamadı. Eğer direkt olarak bir kostüm yazdıysanız onun yerine şampiyon ismi yazarak tekrardan aratabilirsiniz.</p>';
        document.getElementById('pagination').innerHTML = ''; 
        return;
    }

    const startIndex = (page - 1) * itemsPerPage;
    const endIndex = startIndex + itemsPerPage;
    const hesaplarToShow = hesaplarToDisplay.slice(startIndex, endIndex);

    hesaplarToShow.forEach(hesap => {
        const hesapDiv = document.createElement('div');
        hesapDiv.classList.add('hesap-card');
        hesapDiv.innerHTML = `
            <div class="accounts-start">
                <h3>${hesap.accNumber}<br>Sunucu: ${hesap.server}</h3>
            </div>
            <div class="accounts-mid">
                <ul>Kostümler: ${hesap.skins.map(skin => `<li>${renkliSkin(skin)}</li>`).join('')}</ul>
            </div>
            <div class="accounts-end">
                <img src="images/maviOz.png" alt="maviOz" id="maviOzImg">
                <p>${hesap.blueEssence}</p>
                <img src="images/orangeEss.png" alt="turuncuOz" id="turuncuOzImg">
                <p>${hesap.orangeEssence ?? '???'}</p>
            </div>
        `;
        hesapContainer.appendChild(hesapDiv);
    });

    renderPagination(hesaplarToDisplay);
}

// Pagination ve diğer fonksiyonlar aynı şekilde devam eder.


// Sayfa numaralarını ve butonları oluşturma
function renderPagination(hesaplarToDisplay = filteredHesaplar) {
    const pagination = document.getElementById('pagination');
    pagination.innerHTML = '';

    const totalPages = Math.ceil(hesaplarToDisplay.length / itemsPerPage);

    const firstButton = document.createElement('button');
    firstButton.innerText = '<<';
    firstButton.disabled = currentPage === 1;
    firstButton.onclick = () => goToPage(1, hesaplarToDisplay);
    pagination.appendChild(firstButton);

    const prevButton = document.createElement('button');
    prevButton.innerText = '<';
    prevButton.disabled = currentPage === 1;
    prevButton.onclick = () => goToPage(currentPage - 1, hesaplarToDisplay);
    pagination.appendChild(prevButton);

    // Dinamik olarak "..." eklemek ve sayfa numaralarını göstermek
    for (let i = 1; i <= totalPages; i++) {
        if (i === 1 || i === totalPages || (i >= currentPage - 1 && i <= currentPage + 1)) {
            const pageButton = document.createElement('button');
            pageButton.innerText = i;
            pageButton.className = i === currentPage ? 'active' : '';
            pageButton.onclick = () => goToPage(i, hesaplarToDisplay);
            pagination.appendChild(pageButton);
        } else if (i === currentPage - 2 || i === currentPage + 2) {
            const dots = document.createElement('span');
            dots.className = 'dots';
            dots.innerText = '...';
            pagination.appendChild(dots);
        }
    }

    const nextButton = document.createElement('button');
    nextButton.innerText = '>';
    nextButton.disabled = currentPage === totalPages;
    nextButton.onclick = () => goToPage(currentPage + 1, hesaplarToDisplay);
    pagination.appendChild(nextButton);

    const lastButton = document.createElement('button');
    lastButton.innerText = '>>';
    lastButton.disabled = currentPage === totalPages;
    lastButton.onclick = () => goToPage(totalPages, hesaplarToDisplay);
    pagination.appendChild(lastButton);
}

function goToPage(page, hesaplarToDisplay = filteredHesaplar) {
    currentPage = page;
    displayAccountsPaginated(currentPage, hesaplarToDisplay);
}

// Filtreleme butonuna tıklama olayını dinle
document.getElementById("filterSubmit").addEventListener("click", applyFilters);

// Filtreleri sıfırlama butonuna tıklama olayını dinle
document.getElementById("resetFilters").addEventListener("click", resetFilters);

// Filtreleri sıfırlama fonksiyonu
function resetFilters() {
    document.getElementById("server").value = "all";
    document.getElementById("maviOz").value = "all";
    document.getElementById("skins").value = "";
    document.getElementById("accNumber").value = "";

    currentPage = 1;
    filteredHesaplar = hesaplar; 
    displayAccountsPaginated(currentPage, hesaplar);
}
